import React from 'react';
import git from '../git.svg';

const Footer = (props) => {
  return (
	<div className="fl w-100 pt6 pb0 mb0">
      <div className=" tc bg-light-gray">
	      <div className="dib">
		      <span>
			      <a href="#top"><img src={git} /></a>
			      <a href="#top"><img src={git} />kl</a>
		      </span>
	      </div>
      </div>
    </div>
  )
}

export default Footer;
